import { Link } from "react-router-dom";

const EVENTS = [
    {id: 'e1', title: 'Event 1'},
    {id: 'e2', title: 'Event 2'},
    {id: 'e3', title: 'Event 3'},
]

const EventsPage = () => {
  return (
    <>
      <h1>Events page</h1>
      <ul>
        <li>
          <Link to='/events/eventid'>Event 1</Link>
        </li>
        <li>Event 2</li>
        <li>Event 3</li>
      </ul>
    </>
  );
};

export default EventsPage;
